      out.write("	<script>\r\n");
      out.write("	 // 아이디 체크\r\n");
      out.write("		function idCheck(){ \r\n");
      out.write("			// 중복체크(ajax)\r\n");
      out.write("			var $memberId = $(\"#enroll-form input[name=memberId]\");\r\n");
      out.write("			var ok0;\r\n");
      out.write("			$.ajax({\r\n");
      out.write("				url : \"idCheck.us\",\r\n");
      out.write("				data : {checkId : $memberId.val()},\r\n");
      out.write("				async : false,\r\n");
      out.write("				success : function(result){	\r\n");
      out.write("					if(result == \"NNNNN\"){ // 중복된 아이디일 경우\r\n");
      out.write("						$(\"#checkIdFalse\").attr('style',\"display:block;\");\r\n");
      out.write("						$(\"#checkIdTrue\").attr('style',\"display:none;\");\r\n");
      out.write("						$(\"#checkIdIf\").attr('style',\"display:none;\");\r\n");
      out.write("						$memberId.focus();\r\n");
      out.write("					}\r\n");
      out.write("					else { // 중복이 아닌 아이디일 경우\r\n");
      out.write("						// 유효성 검사\r\n");
      out.write("						var regExpId = /^[a-z0-9]{4,12}$/;\r\n");
      out.write("						if(!regExpId.test($memberId.val())){ // 조건에 맞지 않는 아이디일 경우\r\n");
      out.write("							$(\"#checkIdIf\").attr('style',\"display:block;\");\r\n");
      out.write("							$(\"#checkIdTrue\").attr('style',\"display:none;\");\r\n");
      out.write("							$(\"#checkIdFalse\").attr('style',\"display:none;\");\r\n");
      out.write("							$memberId.focus();\r\n");
      out.write("							\r\n");
      out.write("						}else { // 중복x + 조건o인 아이디일 경우\r\n");
      out.write("							$(\"#checkIdTrue\").attr('style',\"display:block;\");\r\n");
      out.write("							$(\"#checkIdFalse\").attr('style',\"display:none;\");\r\n");
      out.write("							$(\"#checkIdIf\").attr('style',\"display:none;\");\r\n");
      out.write("							ok0 = result;\r\n");
      out.write("						}\r\n");
      out.write("					}\r\n");
      out.write("				},\r\n");
      out.write("				error : function(){\r\n");
      out.write("					alert(\"아이디 중복체크용 비동기요청 실패\");\r\n");
      out.write("				}\r\n");
      out.write("			});\r\n");
      out.write("			return ok0;\r\n");
      out.write("		}\r\n");
      out.write("	// 비밀번호 체크\r\n");
      out.write("			var $memberPwd = $(\"#enroll-form input[name=memberPwd]\");\r\n");
      out.write("			\r\n");
      out.write("			var regExpPwd = /^(?!((?:[A-Za-z]+)|(?:[~!@#$%^&*()_+=]+)|(?=[0-9]+))$)[A-Za-z\\d~!@#$%^&*()_+=]{8,16}$/;\r\n");
      out.write("			\r\n");
      out.write("		function pwdCheck(){\r\n");
      out.write("		\r\n");
      out.write("			if($memberPwd.val() != \"\"){\r\n");
      out.write("				\r\n");
      out.write("				if(!regExpPwd.test($memberPwd.val())){ // 조건에 맞지 않는 비밀번호일 경우\r\n");
      out.write("					$(\"#checkPwdFalse\").attr('style',\"display:block\");\r\n");
      out.write("					$(\"#checkPwdTrue\").attr('style', \"display:none\");\r\n");
      out.write("					\r\n");
      out.write("				} else { // 사용가능한 비밀번호\r\n");
      out.write("					$(\"#checkPwdFalse\").attr('style',\"display:none\");\r\n");
      out.write("					$(\"#checkPwdTrue\").attr('style', \"display:block\");\r\n");
      out.write("					var ok1 = \"Y\";\r\n");
      out.write("					return ok1;\r\n");
      out.write("				}\r\n");
      out.write("			} else { // 비밀번호 빈 문자열일 경우\r\n");
      out.write("				$(\"#checkPwdFalse\").attr('style',\"display:none\");\r\n");
      out.write("				$(\"#checkPwdTrue\").attr('style', \"display:none\");\r\n");
      out.write("				$(\"#samePwdFalse\").attr('style',\"display:none\");\r\n");
      out.write("				$(\"#samePwdTrue\").attr('style',\"display:none\");\r\n");
      out.write("			}	\r\n");
      out.write("		}	\r\n");
      out.write("	// 비밀번호 확인\r\n");
      out.write("		function samePwdCheck(){\r\n");
      out.write("			if(regExpPwd.test($memberPwd.val())){ // 일단 비밀번호는 사용가능일 경우\r\n");
      out.write("				if($(\"#samePwd\").val() != $memberPwd.val()){ // 비밀번호와 비밀번호 확인 불일치\r\n");
      out.write("					$(\"#samePwdFalse\").attr('style',\"display:block\");\r\n");
      out.write("					$(\"#samePwdTrue\").attr('style',\"display:none\");\r\n");
      out.write("				} else{	// 비밀번호와 비밀번호 확인 일치\r\n");
      out.write("					$(\"#samePwdFalse\").attr('style',\"display:none\");\r\n");
      out.write("					$(\"#samePwdTrue\").attr('style',\"display:block\");\r\n");
      out.write("					var ok2 = \"Y\";\r\n");
      out.write("					return ok2;\r\n");
      out.write("				}\r\n");
      out.write("			} else { // 비밀번호가 사용불가능(안보여줘도된다.)\r\n");
      out.write("				$(\"#samePwdFalse\").attr('style',\"display:none\");\r\n");
      out.write("				$(\"#samePwdTrue\").attr('style',\"display:none\");\r\n");
      out.write("			}\r\n");
      out.write("			\r\n");
      out.write("		}\r\n");
      out.write("	// 이름\r\n");
      out.write("		function nameCheck(){\r\n");
      out.write("			var $memberName = $(\"#enroll-form input[name=memberName]\");\r\n");
      out.write("			var regExpName = /^[a-zA-Z가-힣]{2,}$/;\r\n");
      out.write("			if(!regExpName.test($memberName.val())){ // 이름을 잘못 입력한 경우\r\n");
      out.write("				$(\"#nameFalse\").attr('style',\"display:block\");\r\n");
      out.write("			} else { // 사용 가능 이름\r\n");
      out.write("				$(\"#nameFalse\").attr('style',\"display:none\");\r\n");
      out.write("				var ok3 = \"Y\";\r\n");
      out.write("				return ok3;\r\n");
      out.write("			}\r\n");
      out.write("			if($memberName.val() == \"\"){\r\n");
      out.write("				$(\"#nameFalse\").attr('style',\"display:none\");\r\n");
      out.write("			}\r\n");
      out.write("		}\r\n");
      out.write("	// 주민등록번호 앞뒷자리\r\n");
      out.write("		function fbnoCheck(){\r\n");
      out.write("			var $memberFno = $(\"#enroll-form input[name=memberFno]\");\r\n");
      out.write("			var $memberBno = $(\"#enroll-form input[name=memberBno]\");\r\n");
      out.write("			var fbno = ($memberFno.val() + \"-\") + $memberBno.val();\r\n");
      out.write("			\r\n");
      out.write("			var regExpfBno = /^\\d{2}(0[1-9]|1[0-2])(0[1-9]|[1-2][0-9]|3[0-1])-[1-4]\\d{6}$/;\r\n");
      out.write("				\r\n");
      out.write("				if(!regExpfBno.test(fbno)){ // 주민번호 잘못 입력한 경우\r\n");
      out.write("					$(\"#fbnoFalse\").attr('style',\"display:block\");\r\n");
      out.write("				\r\n");
      out.write("					if($memberFno.val() != \"\" && $memberBno.val() == \"\"){ // 앞자리부터 입력중일때 빨간글 x\r\n");
      out.write("						$(\"#fbnoFalse\").attr('style',\"display:none\");\r\n");
      out.write("					}\r\n");
      out.write("				\r\n");
      out.write("				} else {	// 잘 입력한 경우\r\n");
      out.write("					$(\"#fbnoFalse\").attr('style',\"display:none\");\r\n");
      out.write("					var ok4 = \"Y\";\r\n");
      out.write("					return ok4;\r\n");
      out.write("				}\r\n");
      out.write("			\r\n");
      out.write("				if($memberBno.val() == \"\" && $memberFno.val()==\"\"){ // 전부 지웠을 경우\r\n");
      out.write("					$(\"#fbnoFalse\").attr('style',\"display:none\");\r\n");
      out.write("				} \r\n");
      out.write("		}\r\n");
      out.write("	// 연락처\r\n");
      out.write("	\r\n");
      out.write("	const autoHyphen2 = (target) => {\r\n");
      out.write("		 target.value = target.value\r\n");
      out.write("		   .replace(/[^0-9]/g, '')\r\n");
      out.write("		  .replace(/^(\\d{0,3})(\\d{0,4})(\\d{0,4})$/g, \"$1-$2-$3\").replace(/(\\-{1,2})$/g, \"\");\r\n");
      out.write("		}\r\n");
      out.write("	// 이메일\r\n");
      out.write("	\r\n");
